import React from 'react';
import {Routes,Router,BrowserRouter} from "react-router-dom";
import signIp from './pages/SignIn';
function App() {
  return (
    <BrowserRouter>
     <Routes>
       <Router path="/signin" element={<signIp/>}/>
     </Routes>
    </BrowserRouter>
  );
}

export default App;
